import React from 'react';
import './styles.css'; // Если ваш стиль в src/styles.css

const Home = () => {
  return (
    <div className="home">
      <h1>Healthy Diet <br />Everyday</h1>
      <p>Order today and receive your <br />package tomorrow</p>
      <button>View Menu</button>
      <button>Book a Table</button>
      <h3>Breakfast</h3>
      <h5>9:00 am - 11:00 am →</h5>
      <img src="assets/images/pasta2.avif" alt="Delicious food" />
    </div>
  );
}

export default Home;
